import React from "react";

const Card = ({dog}) => {
    return (
        <>
            <div className='card'>
                <img src={dog.image} alt='dog' />
                <p>{dog.breed.name}</p>
            </div>
            <div>

            </div>
        </>
    );
}

export default Card;
